import useSWR from 'swr'

const Profile = ()=> {
  const { data, error } = useSWR('https://miras-backend.herokuapp.com/random');

  if (error) return <div>failed to load</div>
  if (!data) return <div>loading...</div>
  console.log(data);
  return(

  <div>
    {data.title}
    <br/>
    <br/>
    {data.about}
    <br/>
    <br/>
    {data.adress}
    <br/>
    <br/>
    {data.ziyaret}
  </div>);
}
export default Profile;
